import React, { Component } from 'react';
import styles from "../css/footer.module.css";

class Footer extends Component {
    constructor(){
        super();
        this.state = {
            blog:[],
            gallery:[]
        }
    }
    componentDidMount(){
        fetch('https://edserver.herokuapp.com/user/category/blog',{
            method: "GET",
            headers: {
                "Accept": "application/json",
                "Content-Type": "application/json"
            }
        }).then(result => {
            result.json().then(response => {
               
                console.log(response)
            })
        }).catch(err => {
            console.log(err)
        })
        
    }
    render() {
        return (
            <footer className={styles.footer}>
            <div className={styles.flexItem}>
                <div className={styles.category} >
                    <h3>Gallery</h3>
                    <li className={styles.photgraghy}>
                    <a href="#"><span>photgraghy</span> <span class="brackets">(2)</span></a> 
                    </li>
                    <li className={styles.fashion}>
                        <a href="#"><span>fashion</span> <span class="brackets">(3)</span></a>
                    </li>
                    <li className={styles.technology}>
                        <a href="#"><span>technology</span> <span class="brackets">(2)</span></a>
                    </li>
                    <li className={styles.travel}>
                        <a href="#"><span>travel</span> <span class="brackets">(3)</span></a>
                    </li>
                </div>

                <div className={styles.category}>
                    <h3>Blog</h3>
                    <li class="November 2018 ">
                        <a href="#"><span>November 2018 </span> <span class="brackets">(3)</span></a>
                    </li>
                    <li class="October 2018 ">
                        <a href="#"><span>October 2018 </span> <span class="brackets">(7)</span></a>
                    </li>
                    <li class="September 2018 ">
                        <a href="#"><span>September 2018 </span> <span class="brackets">(5)</span></a>
                    </li>
                    <li class="August 2018">
                        <a href="#"><span>August 2018</span> <span class="brackets">(6)</span></a>
                    </li>
                </div>

                <div className={styles.category}>
                    <h3>Have a questions?</h3>
                    <li>
                        <a href="#">
                        <span>
                            203 Fake St. Mountain View, San Francisco, California, USA
                        </span>
                        </a>
                    </li>
                    <li>
                        <a href="#">
                        <span>
                            +2 392 3929 210
                        </span>
                        </a>
                    </li>
                    <li>
                    <a href="mailto:info@yourdomain.com">info@yourdomain.com</a>
                    </li>
                </div>
            </div>
                <p className={styles.para}>
                    Copyright Â©2020 All rights reserved 
                </p>
            </footer>

        );
    }
}

export default Footer;
